import React, { useState } from "react";
import AddUser from "./components/User/AddUser";
import UsersList from "./components/User/UsersList";

function App() {
  const [userData, setUserData] = useState([{}]);
  return (
    <div>
      <AddUser />
      <UsersList users={userData} />
    </div>
  );
}

export default App;
